import React from 'react';
import {Row, Col} from 'reactstrap';

export const Contact = () => {
    return (
        <div className="contactDiv" style={{marginTop:"3rem"}} >
          <span className="contactTitle">Call at: </span> <span className="contactDetails"> +91 7276072667 </span> <br /> 
          <span className="contactTitle">Mail at: </span> <span className="contactDetails"> maithiaharsh@gmail.com </span>  

          <Row>
            <Col sm={{ size: 'auto', offset: 1 }}>.col-sm-auto .offset-sm-1</Col>
            <Col sm={{ size: 'auto', offset: 1 }}>.col-sm-auto .offset-sm-1</Col>
        </Row>


        </div>
    )
}
